import axios, { AxiosResponse } from "axios";

const getNewCategor = ()=> {
  const requestUrl = "https://api.tvmaze.com/search/shows?q=car";
  const response = axios.get(requestUrl);
  console.log(response)
  return response;
  
};
export default getNewCategor;
